                            </div>
                        </div>
                    </div>
                    {/* <!--End Header Upper--> */}

                    {/* <!-- Sticky Header  --> */}
                    <div class={scrolled ? "sticky-header animated slideInDown" : "sticky-header"}>
                        <div class="auto-container clearfix">
